  render() {
    return (
        <div className="section-box-main">
              <div className="box-left">
                <div className="container">
                  <div className="row">
                    <div className="col" >
                       <h6 className="text-muted" id="div-name">Duong Tan Tai</h6> 
                    <div className="list-group">
                      <a href="#" className="list-group-item list-group-item-action active" id="item-point" onClick={this.chuyendi}><img src="https://d1785e74lyxkqq.cloudfront.net/_next/static/v2/5/5aee8aca6897d279a7cb105f7e167754.svg" />Điểm thưởng của tôi</a>
